import React from 'react' ;
import { useState } from 'react';
import useStyles from './Request-jss';


const InputElement = (props) => {

  const classes = useStyles()

  const [category , setCategory] = useState({ category : null})


  console.log(category.category)

  
  let element = null ;

  const changeCategory = (event) =>{ setCategory({category : event.target.value})}
              


  
    return (
    <div className={`${classes.page} text-center`}>   
        <div className='form-group'>
                <select
                  id={props.name}
                  name={props.name}
                  onChange={changeCategory}
                  className='custom-select input-select input-text' >
                    <option value='0'>{props.pardefaut}</option>
                    <>
                      <option key='1' value='1'>{props.name}</option>
                      <option key='2' value='2'>{props.name}</option>
                      <option key='3' value='3'>{props.name}</option>
                      <option key='4' value='4'>{props.name}</option>
                    </>
                </select>
        </div>
    </div> 
    )
}

export default InputElement ;
